import axios from "axios"

const api = axios.create({
    baseURL: "https://pokeapi.co/api/v2/"
})

function Detalhes(pokemon) {
    return fetch(`${api}pokemon/${pokemon}`).then((res) => res.json())
}

export default Detalhes(pokemon)
